<!DOCTYPE html>
<html>
<head>
    <style>
        .t1 {

</head>

<body ng-app="cs-app" ng-controller="MainView" ng-init="load('doer-mar-14.json')">
<div class="controls">

    <button ng-click="b2click()">Stop</button>&#160;&#160;&#160;
    <a href="index.html">March 5, on production with wof</a>&#160;&#160;&#160;
    <a href="doer-mar-14.html">March 14, new dispatch</a>&#160;&#160;&#160;
    <br/>
    <br/>
    <button ng-click="b_backward_click()">&lt;- Backward</button>
    <button ng-click="b_forward_click()">Forward &gt;</button>&#160;&#160;&#160;
    <button ng-click="setTime(sliderTime = 1552572402000)">15:06:42 proxy restart<br/> cloudscan restart</button>&#160;&#160;&#160;
    <button ng-click="setTime(sliderTime = 1552572524977)">15:08:44 cloudscan started</button>&#160;&#160;&#160;
    <br/>
    <br/>
    <input type="range" min="{{minTime}}" max="{{maxTime}}" value="0" class="slider" ng-model="sliderTime"
           ng-model-options="{ debounce: 100 }" ng-change="setTime(sliderTime)"/>
    <br/>
    <br/>
    <h1 class="current-time">{{time | date:'medium' }}</h1>
</div>
